(3714, '8c1e06dc-3c79-4d4a-ad70-afad5070c636', '8c1e06dc-431d-4d07-9821-dc39bcf014cd', NULL, 1, 'model', '{\"action\":\"updated\",\"model\":\"App\\\\Model\\\\admin\\\\blog_post:12\",\"changes\":{\"blog_post_body\":\"&lt;p&gt;This is some sample content.The three greatest things you learn from traveling. Like all the great things on earth traveling teaches us by example. Here are some of the most precious lessons I\\u2019ve learned over the years of traveling.&lt;\\/p&gt;&lt;h3&gt;Appreciation of diversity&lt;\\/h3&gt;&lt;p&gt;Getting used to an entirely different culture can be challenging. While it\\u2019s also nice to learn about cultures online or from books, nothing comes close to experiencing cultural diversity in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.&lt;\\/p&gt;&lt;blockquote&gt;&lt;p&gt;The real voyage of discovery consists not in seeking new landscapes, but having new eyes.&lt;\\/p&gt;&lt;p&gt;&lt;strong&gt;Marcel Proust&lt;\\/strong&gt;&lt;\\/p&gt;&lt;\\/blockquote&gt;&lt;h3&gt;Improvisation&lt;\\/h3&gt;&lt;p&gt;Life doesn\'t allow us to execute every single plan perfectly. This especially seems to be the case when you travel. You plan it down to every minute with a big checklist; but when it comes to executing it, something always comes up and you\\u2019re left with your improvising skills. You learn to adapt as you go. Here\\u2019s how my travel checklist looks now:&lt;\\/p&gt;&lt;ul&gt;&lt;li&gt;buy the ticket&lt;\\/li&gt;&lt;li&gt;start your adventure&lt;\\/li&gt;&lt;\\/ul&gt;&lt;img alt=&quot;Three Monks walking on ancient temple&quot;&gt;Leaving your comfort zone might lead you to such beautiful sceneries like this one.&lt;h3&gt;Confidence&lt;\\/h3&gt;&lt;p&gt;Going to a new place can be quite terrifying. While change and uncertainty makes us scared, traveling teaches us how ridiculous it is to be afraid of something before it happens. The moment you face your fear and see there was nothing to be afraid of, is the moment you discover bliss.&lt;\\/p&gt;\",\"updated_at\":\"2018-10-27 02:05:19\"},\"hostname\":\"Patrick-PC\"}', '2018-10-27 02:05:20'),
